var express = require('express');
// Import the library:
var cors = require('cors');

var app = express();

// Then use it before your routes are set up:
app.use(cors());

window.jQuery.ajaxSetup({
    headers: {
        'X-CSRF-TOKEN': window.jQuery('meta[name="csrf-token"]').attr('content')
    }
});
app.get = (url, postData) => {
    return window.jQuery.when(window.jQuery.ajax({
        method: "GET",
        url: url,
        data: postData,
        dataType: "json"
      }))
      .done((rs) => {
          console.log(rs)
      });
}

export default obj;
